import './App.css';
import HeadBackground from './components/header/HeadBackground';
import HeadTitle from './components/header/HeadTitle';
import NextLast from './components/match/NextLast';
import UpcomingMatches from './components/match/UpcomingMatches';
import Navbar from './components/navbar/Navbar';
import image from './images/main-head.jpg';
import MainPageNews from './components/news/MainPageNews';
import Panel from './components/panel/panel'





export default function App() {
  return (
    <div>
      <Navbar />
      <div className="wrapper">
        <div className="container">
          <HeadBackground 
            src={image}
            />
          <HeadTitle 
            text="SPR BOR Oborniki Śląskie"
            />
          <UpcomingMatches />
        <div className="content-container">
            <NextLast />
            <MainPageNews />
            <Panel 
              title="Nasza młodzież"
              imgSrc={image}
              description="Prowadzimy zajęcia dla dzieci z różnych grup wiekowych. Nasi wychowankowie rozjeżdżają się po Polsce ale także całym świecie mając w sercach nasz klub, nasze miasto i miłość do piłki ręcznej. "
              />
          </div>
        </div>
      </div>
    </div>
  );
}
